import React from 'react';
import IconText from '../iconText/IconText'
import InboxIcon from '@material-ui/icons/Inbox';
import StarIcon from '@material-ui/icons/Star';
import ScheduleIcon from '@material-ui/icons/Schedule';
import SendIcon from '@material-ui/icons/Send';
import DraftsIcon from '@material-ui/icons/Drafts';
import GroupIcon from '@material-ui/icons/Group';
function RightSideBarInbox(props) {
    return (
        <div className="right-side-box-inbox">
            <IconText text1="Inbox" text2="28,307" className="icontext-child" >
                <InboxIcon/>
            </IconText>
            <IconText text1="Starred" text2="" >
                <StarIcon/>
            </IconText>
            <IconText text1="Snooze" text2="" >
                <ScheduleIcon/>
            </IconText>
            <IconText text1="Send" text2="" >
                <SendIcon/>
            </IconText>
            <IconText text1="Draft" text="">
                <DraftsIcon/>
            </IconText>
            <IconText text1="Draft" text="">
                <DraftsIcon/>
            </IconText>
            <IconText text1="Draft" text="">
                <DraftsIcon/>
            </IconText>
            <IconText text1="Draft" text="">
                <DraftsIcon/>
            </IconText>
        </div>
    );
}

export default RightSideBarInbox;
